import React, { useState} from 'react';
import s from './Counter.module.css'
import Button from '@mui/material/Button';



export const Counter = () => {

    const [counter,SetCounter]=useState(0)




      const onclickInc = () => {

          SetCounter(counter+1)

     }

     const  Reset =()=> {
        SetCounter(0)
     }



    return (
        <div className={s.fon}>
            <div className={s.around}>

                <input value={counter}/>
                <div className={s.button}>

                    <Button   style={{maxWidth: '50px', maxHeight: '40px', minWidth: '40px', minHeight: '40px', marginLeft:'20px',background:'aquamarine'}}
                        onClick={onclickInc} disabled={counter===5} variant="outlined" size="large">
                        inc
                    </Button>
                    <Button  style={{maxWidth: '50px', maxHeight: '40px', minWidth: '40px', minHeight: '40px',marginLeft:'20px'}}
                             onClick={Reset} variant="outlined" size="large">
                        reset
                    </Button>
                </div>
            </div>


        </div>
    );
};
